/**
 * Lookup the icon for a given token symbol
 *
 * @memberOf CaskSDK.assetIcons
 * @param symbol
 * @return {string} svg icon
 */
function lookupIcon(symbol) {

    const cleanSymbol = symbol.replace(/\.[^.]+$/, "").toUpperCase();
    const icon = assetIcons[cleanSymbol];

    return icon ? icon : assetIcons.DEFAULT_ICON;
}

export default {
    ...assetIcons,
    lookupIcon,
}
